import React from "react";
import logo from "./logo.svg";
import "./App.css";
import Navbar from "./components/Navbar";
import Header from "./components/Header";
import Jumbotron from "./components/Jumbotron";
import { Container, Row, Col,Card } from "./components/Grid";
import Footer from "./components/Footer";


function App() {
  return (
    <div>
      <Jumbotron />
      <Navbar />
      <Header />
      <Container>

      {/* Start first row */}
      <Row>
          Row 1
        <Col size="xs-9 sm-10">
            Column 1
          <Card>
              Card text
          </Card>

        </Col>
        <Col size="xs-9 sm-10">
          Column 2

        </Col>  
      </Row>

      {/* Start second row */}
      <Row>
          Row 1
      <Col size="xs-9 sm-10">
            Column 1
      </Col>
          <Col size="xs-9 sm-10">
          Column 2
      </Col>
      </Row>



      </Container>
      <Footer />
    </div>
  );
}

export default App;
